import React, { Component } from 'react'

class Login extends Component {
  render() {
    return (
      <div>
        <input data-testid="email-input" placeholder="insira seu email" type="text" />
        <input data-testid="password-input" placeholder="insira seu email" type="password" />
      </div>
    );
  }
}

export default Login;
